import React from 'react'
import styled from 'styled-components'


const Card = styled.div`
background:black;
display:flex;
width:100%;
height:45rem;
align-items:center;
justify-content:center;
`;

const Tagline = styled.div`
`;


function CarCard() {
  return (
    <Card>
        <Tagline></Tagline>
    </Card>
  )
}

export default CarCard
